import Nav from '@/components/nav.vue';
import Banner from '@/components/banner.vue';
import CommentBody from '@/components/common-body.vue';
import ToLogReg from '@/components/to-log-reg.vue';
import LogReg from '@/components/log-reg.vue';
import Copyright from '@/components/copyright.vue';
import QuickToDoc from '@/components/quick-to-doc.vue';
import GoTop from '@/components/gotop.vue';
import Introuduce from '@/components/introduce/introduce.vue';
import Loading from '@/components/loading';
var top = 0;
export default {
  data: function data() {
    return {
      banner: []
    };
  },
  components: {
    Introuduce: Introuduce,
    Nav: Nav,
    Banner: Banner,
    'comment-body': CommentBody,
    ToLogReg: ToLogReg,
    LogReg: LogReg,
    Copyright: Copyright,
    QuickToDoc: QuickToDoc,
    GoTop: GoTop,
    Loading: Loading
  },
  mounted: function mounted() {
    var _this = this;

    document.documentElement.scrollTop = top;
    var token = window.localStorage.getItem('token');

    if (token) {
      this.$root.islog = "log-reg";
    } else {
      this.$root.islog = "to-log-reg";
    }

    this.$axios({
      url: '/api/banner',
      params: {
        _page: 1,
        _limit: 6
      }
    }).then(function (res) {
      return _this.banner = res.data.data;
    });
  },
  updated: function updated() {},
  destroyed: function destroyed() {
    top = document.documentElement.scrollTop; // console.log('destroyed',top);
  },
  methods: {}
};
